import styled from "styled-components";
// import { Link } from "react-router-dom";

export const Activities = styled.div`
  background-color: white;
  box-shadow: 5px 5px 15px rgba(0, 0, 0, 0.1);
  margin-top: 2em;
  h3 {
    text-align: center;
    margin-bottom: 0.5em;
  }
  ul {
    list-style: none;
  }
  ul > li {
    display: inline;
  }

  img {
    display: none;
  }
`;
